import React from "react";
import "./Form.css";
//import CountryCity from "./CountryCity";
import useForm from "./useForm";
import validate from "./ValidateInfo";
import { Inner } from "../Inner";

function Form() {
  const [participantDetails, setparticipantDetails] = useState("");
  const [organizationName, setorganizationName] = useState("");
  const [organizationDetails, setorganizationDetails] = useState("");
  const [projectName, setprojectName] = useState("");
  const [projectDiscription, setprojectDiscription] = useState("");
  const [country, setcountry] = useState("");
  const [city, setcity] = useState("");
  const [goal, setGoal] = useState("");
  const [startDate, setstartDate] = useState("");
  const [endDate, setendDate] = useState("");
  const [document, setdocument] = useState("");
  const [materialDiscription, setmaterialDiscription] = useState("");

  const handleSubmit = (e) => {
    e.preventDefault();



  };




  return (
    <div className="form">
      <form onSubmit={handleSubmit}>
        <Inner>

          <div className="form__row">
            <h3>PARTICIPANT DETAILS</h3>
            <input
              type="text"
              name="participantRole"
              placeholder="Pariticipant Role in Organization"
              onChange={(e)=>{setparticipantDetails(e.target.value);}}
              className={`${errors.organizationname} ? "error" : "success"`}
              onBlur={handleSubmit}
              autoComplete="off"
            />
            <h3>ORGANIZATION DETAILS</h3>
            <input
              type="text"
              name="organizationname"
              placeholder="Organization Name"
              onChange={(e)=>{setorganizationName(e.target.value);}}
              className={`${errors.organizationname} ? "error" : "success"`}
              onBlur={handleSubmit}
              autoComplete="off"
            />



            <input
              type="text"
              name="organizationdetails"
              placeholder="Organization Details...."        
              onChange={(e)=>{setorganizationDetails(e.target.value);}}
              className={`${errors.organizationdetails} ? "error" : "success"`}
              onBlur={handleSubmit}
              autoComplete="off"
            />

            <h3>  PROJECT-DETAILS</h3>
            <input
              type="text"
              name="projectname"
              placeholder="Project Name"
              onChange={(e)=>{setprojectName(e.target.value);}}
              className={`${errors.projectname} ? "error" : "success"`}
              onBlur={handleSubmit}
              autoComplete="off"
            />


            <input
              type="text"
              name="projectdescription"
              placeholder="Project Description *"
              onChange={(e)=>{setprojectDiscription(e.target.value);}}
              className={`${errors.projectdescription} ? "error" : "success"`}
              onBlur={handleSubmit}
              autoComplete="off"
            />

            <input
              type="text"
              name="country"
              placeholder="Country "
              onChange={(e)=>{setcountry(e.target.value);}}
              className={`${errors.country} ? "error" : "success"`}
              onBlur={handleSubmit}
              autoComplete="off"
            />
            <input
              type="text"
              name="city"
              placeholder="City "
              onChange={(e)=>{setcity(e.target.value);}}
              className={`${errors.city} ? "error" : "success"`}
              onBlur={handleSubmit}
              autoComplete="off"
            />


            <input
              type="number"
              name="amountrequired"
              placeholder="Amount Required / Goal"
              onChange={(e)=>{setGoal(e.target.value);}}
              className={`${errors.amountrequired} ? "error" : "success"`}
              onBlur={handleSubmit}
              autoComplete="off"
            />
            <h4>Start Date</h4>
            <input
              type="date"
              name="startdate"
              placeholder="Start Date"
              onChange={(e)=>{setstartDate(e.target.value);}}
              className={`${errors.startdate} ? "error" : "success"`}
              onBlur={handleSubmit}
              autoComplete="off"
            />
            <h4>End Date</h4>
            <input
              type="date"
              name="enddate"
              placeholder="End Date"
              onChange={(e)=>{setendDate(e.target.value);}}
              className={`${errors.enddate} ? "error" : "success"`}
              onBlur={handleSubmit}
              autoComplete="off"
            />
            <h4>SUPPORTING-MATERIAL</h4>
            <p>Related Images / Videos</p>
            <input
              type="file"
              name="document"
              placeholder="UPLOAD"
              onChange={(e)=>{setparticipantDetails(e.target.value);}}
              className={`${errors.document} ? "error" : "success"`}
              onBlur={handleSubmit}
              autoComplete="off"
            />
              <input
              type="text"
              name="materialdescription"
              placeholder="Material Description"
              onChange={(e)=>{setparticipantDetails(e.target.value);}}
              className={`${errors.projectdescription} ? "error" : "success"`}
              onBlur={handleSubmit}
              autoComplete="off"
            />



            <button>SUBMIT</button>
          </div>
        </Inner>
      </form>
    </div>
  );
}

export default Form;
